-- TOC entry 314 (class 1259 OID 33380)
-- Name: top_tiles_view; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW top_tiles_view AS
 SELECT count(account_members.id) AS totalclients,
    ( SELECT count(u.id) AS count
           FROM (users u
             JOIN user_groups ug ON ((ug.id = u.groupid)))
          WHERE (lower((ug.name)::text) = lower('doctor'::text))) AS totaldoctors,
    ( SELECT count(consultations.id) AS count
           FROM consultations
          WHERE (consultations.createddate >= (now() - '7 days'::interval day))) AS thisweekcalls,
    ( SELECT count(consultations.id) AS count
           FROM consultations
          WHERE ((consultations.createddate)::date = (now())::date)) AS todaycalls
   FROM account_members;


